import React from "react";

function PollQuestion() {
  return (
    <div style={{ height: "22vh", width: "100%", marginTop: "2vh" }}>
      <p style={{ fontWeight: "600", fontSize: "1.3em", letterSpacing: "1px" }}>
        Q.1 Question place holder for analysis ?{" "}
      </p>

      <div
        style={{
          display: "flex",
          gap: "4vw",
          marginLeft: "2vw",
          marginTop: "4vh",
        }}
      >
        <div
          style={{
            color: "#474444",
            fontWeight: "600",
            backgroundColor: "white",
            borderRadius: "5px",
            paddingLeft: "1.5vw",
            paddingRight:"1.5vw",
            width:"14vw"
          }}
        >
          <p style={{ fontSize: "2em", paddingTop: "2.5vh",
            paddingBottom: "2vh", }}>
            60
            <span style={{ fontSize: "0.5em",marginLeft:"1vw" }}>Option 1</span>{" "}
          </p>
        </div>

        <div
        style={{
            color: "#474444",
            fontWeight: "600",
            backgroundColor: "white",
            borderRadius: "5px",
            paddingLeft: "1.5vw",
            paddingRight:"1.5vw",
            width:"14vw"
          }}
        
        >
          <p>23 Option 2</p>
        </div>

        <div
           style={{
            color: "#474444",
            fontWeight: "600",
            backgroundColor: "white",
            borderRadius: "5px",
            paddingLeft: "1.5vw",
            paddingRight:"1.5vw",
            width:"14vw"
          }}
        >
          <p>45 Option 3</p>
        </div>

        <div
           style={{
            color: "#474444",
            fontWeight: "600",
            backgroundColor: "white",
            borderRadius: "5px",
            paddingLeft: "1.5vw",
            paddingRight:"1.5vw",
            width:"14vw"
          }}
        >
          <p>11 Option 4</p>
        </div>
      </div>
    </div>
  );
}

export default PollQuestion;
